/*Table structure for table `li_carts` */

DROP TABLE IF EXISTS `li_carts`;

CREATE TABLE `li_carts` (
  `id` int(10) unsigned NOT NULL AUTO_INCREMENT,
  `session_id` varchar(255) COLLATE utf8_unicode_ci NOT NULL COMMENT 'sessionId',
  `user_id` int(11) NOT NULL COMMENT '用户ID',
  `good_id` int(11) NOT NULL COMMENT '商品ID',
  `good_title` varchar(255) COLLATE utf8_unicode_ci DEFAULT '' COMMENT '商品名称',
  `good_spec_key` varchar(255) COLLATE utf8_unicode_ci DEFAULT '' COMMENT '商品规格key',
  `good_spec_name` varchar(255) COLLATE utf8_unicode_ci DEFAULT '' COMMENT '商品规格组合名称',
  `nums` int(11) NOT NULL DEFAULT '0' COMMENT '数量',
  `price` decimal(10,2) NOT NULL DEFAULT '0.00' COMMENT '价格',
  `total_prices` decimal(10,2) NOT NULL DEFAULT '0.00' COMMENT '总价',
  `selected` tinyint(4) NOT NULL DEFAULT '1' COMMENT '购物车选中状态',
  `type` tinyint(4) NOT NULL DEFAULT '0' COMMENT '0普通订单,1团购',
  `created_at` timestamp NULL DEFAULT NULL,
  `updated_at` timestamp NULL DEFAULT NULL,
  PRIMARY KEY (`id`),
  KEY `carts_session_id_index` (`session_id`)
) ENGINE=InnoDB AUTO_INCREMENT=154 DEFAULT CHARSET=utf8 COLLATE=utf8_unicode_ci;

