insert  into `li_categorys`(`id`,`parentid`,`arrparentid`,`child`,`arrchildid`,`name`,`thumb`,`title`,`keyword`,`describe`,`content`,`theme`,`type`,`url`,`sort`,`created_at`,`updated_at`) values (1,0,'0',0,'1','关于我们','/upload/attrs/20170426/20170426025447707.jpg','希夷信息技术工作室','希夷信息技术工作室','希夷工作室：拥有多名优秀成员，整个团队工作分工明确，又相互衔接，密不可分。为跟进技术变革，我工作室对工作人员进行定期定向技能培训，保证市场人员拥有先进的行业理念，客服人员可以创造一流的服务质量，设计人员具有敏锐的视觉洞察力，开发人员保持在技术发展的最前延，我们始终认为：不间断的学习才能在飞速发展的互联网时代长久立足。','<span style=\"color:#333333;font-family:\" font-size:14px;white-space:normal;background-color:#f2efea;\"=\"\">\n<div class=\"page_content mt30\" style=\"box-sizing:border-box;border:0px;background-image:initial;background-position:initial;background-size:initial;background-repeat:initial;background-attachment:initial;background-origin:initial;background-clip:initial;margin:30px 0px 0px;padding:0px;color:#333333;font-family:\" font-size:14px;white-space:normal;\"=\"\">\n<div class=\"bg_about pd30 clearfix\" style=\"box-sizing:border-box;border:0px;background:#F2EFEA;margin:0px;padding:30px;\">\n	<div class=\"pull-right about_img\" style=\"box-sizing:border-box;border:0px;background:transparent;margin:0px;padding:0px;float:right !important;\">\n		<img src=\"https://img.ibomedia.ca/2016/02/cnt-p04-590x700.jpg\" class=\"img-responsive\" alt=\"\" style=\"box-sizing:border-box;vertical-align:middle;background:transparent;margin:0px;padding:0px;display:block;max-width:100%;height:auto;\" /> \n	</div>\n	<div class=\"bg_about __reader_view_article_wrap_8603891041262857__\" style=\"box-sizing:border-box;border:0px;background-image:initial;background-position:initial;background-size:initial;background-repeat:initial;background-attachment:initial;background-origin:initial;background-clip:initial;margin:0px;padding:0px;\">\n		<h2 class=\"about_h2\" style=\"box-sizing:border-box;font-family:inherit;font-weight:normal;line-height:1.1;color:inherit;margin:30px 0px;font-size:30px;border-width:0px 0px 5px;border-top-style:initial;border-right-style:initial;border-bottom-style:solid;border-left-style:initial;border-top-color:initial;border-right-color:initial;border-bottom-color:#FFFFFF;border-left-color:initial;border-image:initial;background:transparent;padding:0px 0px 30px;\">\n			希夷 工作室\n		</h2>\n		<p style=\"box-sizing:border-box;margin-top:0px;margin-bottom:0px;border:0px;background:transparent;padding:0px;\">\n			希夷工作室：拥有多名优秀成员，整个团队工作分工明确，又相互衔接，密不可分。为跟进技术变革，我工作室对工作人员进行定期定向技能培训，保证市场人员拥有先进的行业理念，客服人员可以创造一流的服务质量，设计人员具有敏锐的视觉洞察力，开发人员保持在技术发展的最前延，我们始终认为：不间断的学习才能在飞速发展的互联网时代长久立足。\n		</p>\n		<h2 class=\"about_h2\" style=\"box-sizing:border-box;font-family:inherit;font-weight:normal;line-height:1.1;color:inherit;margin:30px 0px;font-size:30px;border-width:0px 0px 5px;border-top-style:initial;border-right-style:initial;border-bottom-style:solid;border-left-style:initial;border-top-color:initial;border-right-color:initial;border-bottom-color:#FFFFFF;border-left-color:initial;border-image:initial;background:transparent;padding:0px 0px 30px;\">\n			核心 理念\n		</h2>\n		<p style=\"box-sizing:border-box;margin-top:0px;margin-bottom:0px;border:0px;background:transparent;padding:0px;\">\n			希夷工作室自成立之日一直致力于为客户提升企业形象，创造实际市场价值。因为我们始终从市场的角度与客户本身状态出发，帮助客户找到真正的自我价值，树立良好企业形象，同时展开市场拓展，使得许多客户在同行业激烈竞争中突显出了更高层次的品牌价值。\n		</p>\n		<h2 class=\"about_h2\" style=\"box-sizing:border-box;font-family:inherit;font-weight:normal;line-height:1.1;color:inherit;margin:30px 0px;font-size:30px;border-width:0px 0px 5px;border-top-style:initial;border-right-style:initial;border-bottom-style:solid;border-left-style:initial;border-top-color:initial;border-right-color:initial;border-bottom-color:#FFFFFF;border-left-color:initial;border-image:initial;background:transparent;padding:0px 0px 30px;\">\n			工作 目标\n		</h2>\n		<p style=\"box-sizing:border-box;margin-top:0px;margin-bottom:0px;border:0px;background:transparent;padding:0px;\">\n			希夷工作室，以本地的市场为主为多家企业事业单位提供技术支持。我们旨在专心做技术，良心做服务，希望通过专业技术与真诚服务为不同客户创造高质量服务，同时塑造一个立身本地的人性化品牌服务团队。\n		</p>\n		<p style=\"box-sizing:border-box;margin-top:0px;margin-bottom:0px;border:0px;background:transparent;padding:0px;\">\n			《老子》：“视之不见名曰夷，听之不闻名曰希。”虚寂玄妙。\n		</p>\n	</div>\n</div>\n	</div>\n</span>','page',1,'guan-yu-wo-men',0,'2017-04-26 00:42:45','2017-07-02 09:37:15'),(2,0,'0',0,'2','产品中心','/upload/attrs/20170426/20170426065951690.jpeg','产品中心',NULL,NULL,NULL,'list_pro',0,'chan-pin-zhong-xin',0,'2017-04-26 02:48:36','2017-04-26 06:59:54'),(3,0,'0',0,'3','新闻资讯','/upload/attrs/20170426/20170426025521561.jpg','新闻资讯',NULL,NULL,NULL,'list',0,'xin-wen-zi-xun',0,'2017-04-26 02:49:00','2017-04-26 02:55:23'),(4,0,'0',0,'4','联系我们','/upload/attrs/20170426/20170426025533930.jpg','联系我们',NULL,NULL,NULL,'page',1,'lian-xi-wo-men',0,'2017-04-26 02:49:14','2017-04-26 02:55:35');

