/*Table structure for table `li_goods` */

DROP TABLE IF EXISTS `li_goods`;

CREATE TABLE `li_goods` (
  `id` int(10) unsigned NOT NULL AUTO_INCREMENT,
  `cate_id` int(11) NOT NULL COMMENT '商品分类ID',
  `title` varchar(255) COLLATE utf8_unicode_ci NOT NULL COMMENT '标题',
  `pronums` varchar(255) COLLATE utf8_unicode_ci DEFAULT NULL COMMENT '商品编号',
  `keyword` varchar(255) COLLATE utf8_unicode_ci DEFAULT NULL COMMENT '关键字',
  `describe` varchar(255) COLLATE utf8_unicode_ci DEFAULT NULL COMMENT '描述',
  `thumb` varchar(255) COLLATE utf8_unicode_ci DEFAULT NULL COMMENT '缩略图',
  `content` text COLLATE utf8_unicode_ci COMMENT '内容',
  `notice` text COLLATE utf8_unicode_ci COMMENT '购买须知',
  `pack` text COLLATE utf8_unicode_ci COMMENT '规格包装',
  `price` decimal(10,2) NOT NULL DEFAULT '0.00' COMMENT '价格',
  `store` int(11) NOT NULL DEFAULT '100' COMMENT '库存',
  `weight` decimal(8,2) NOT NULL DEFAULT '1.00' COMMENT '重量',
  `tags` varchar(50) COLLATE utf8_unicode_ci DEFAULT NULL COMMENT '标签',
  `isxs` tinyint(4) NOT NULL DEFAULT '0' COMMENT '是否限时：1是，0否',
  `starttime` timestamp NULL DEFAULT NULL COMMENT '限时开始时间',
  `endtime` timestamp NULL DEFAULT NULL COMMENT '限时结束时间',
  `isxl` tinyint(4) NOT NULL DEFAULT '0' COMMENT '是否限量：1是，0否',
  `xlnums` int(11) NOT NULL DEFAULT '1' COMMENT '限制数量',
  `sort` int(11) NOT NULL DEFAULT '0' COMMENT '排序',
  `sales` int(11) NOT NULL DEFAULT '0' COMMENT '销量',
  `score` decimal(10,2) NOT NULL DEFAULT '0.00' COMMENT '评分',
  `commentnums` int(11) NOT NULL DEFAULT '0' COMMENT '评论数',
  `status` tinyint(4) NOT NULL DEFAULT '1' COMMENT '状态，1正常0下架',
  `created_at` timestamp NULL DEFAULT NULL,
  `updated_at` timestamp NULL DEFAULT NULL,
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=770 DEFAULT CHARSET=utf8 COLLATE=utf8_unicode_ci;

