/*Table structure for table `li_orders` */

DROP TABLE IF EXISTS `li_orders`;

CREATE TABLE `li_orders` (
  `id` int(10) unsigned NOT NULL AUTO_INCREMENT,
  `order_id` char(20) COLLATE utf8_unicode_ci NOT NULL COMMENT '订单ID',
  `user_id` int(11) NOT NULL COMMENT '用户ID',
  `tuan_id` int(11) NOT NULL DEFAULT '0' COMMENT '团购ID',
  `address_id` int(11) NOT NULL DEFAULT '0' COMMENT '送货地址',
  `yhq_id` int(11) NOT NULL DEFAULT '0' COMMENT '优惠券id',
  `yh_price` decimal(8,2) NOT NULL DEFAULT '0.00' COMMENT '优惠券金额',
  `old_prices` decimal(8,2) NOT NULL DEFAULT '0.00' COMMENT '原价',
  `total_prices` decimal(10,2) NOT NULL DEFAULT '0.00' COMMENT '总价',
  `create_ip` varchar(50) COLLATE utf8_unicode_ci NOT NULL COMMENT '创建IP',
  `paystatus` tinyint(4) NOT NULL DEFAULT '0' COMMENT '支付状态,0未，1已',
  `pay_name` varchar(50) COLLATE utf8_unicode_ci DEFAULT NULL COMMENT '支付方式',
  `shipstatus` tinyint(4) NOT NULL DEFAULT '0' COMMENT '发货状态,0未，1已',
  `ship_at` timestamp NULL DEFAULT NULL COMMENT '发货时间',
  `area` varchar(50) COLLATE utf8_unicode_ci DEFAULT NULL COMMENT '区域',
  `ziti` int(11) NOT NULL DEFAULT '0' COMMENT '自提点',
  `mark` varchar(500) COLLATE utf8_unicode_ci DEFAULT '' COMMENT '用户备注',
  `shopmark` varchar(500) COLLATE utf8_unicode_ci DEFAULT '' COMMENT '商家备注',
  `orderstatus` tinyint(4) NOT NULL DEFAULT '1' COMMENT '订单状态，1正常2完成0关闭',
  `confirm_at` timestamp NULL DEFAULT NULL COMMENT '确认收货时间',
  `status` tinyint(4) NOT NULL DEFAULT '1' COMMENT '状态，1正常0删除',
  `created_at` timestamp NULL DEFAULT NULL,
  `updated_at` timestamp NULL DEFAULT NULL,
  PRIMARY KEY (`id`,`status`)
) ENGINE=InnoDB AUTO_INCREMENT=163 DEFAULT CHARSET=utf8 COLLATE=utf8_unicode_ci;

